import React from 'react';
import { Redirect } from 'react-router';
import './App.css';
import Home from './pages/Home';

class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            loggedIn: false
        }
    }
    render() {
        return (
            <div className="App">
                {this.state.isLoggedin ? <Redirect to="/home" /> : <Redirect to="Login" />}
            </div>
        );
    }
}

export default App;
